import React, { Component } from "react";
import axios from "axios";
import "antd/dist/antd.css";
import { Input } from 'antd';
import { Popover } from 'antd';

const { Search } = Input;


export default class Katalog extends Component {
    constructor(props) {
        super(props);
        this.state = {
            modelos: [],
            visible: false,
            nome: "",
            codigo: "",
        };
    }
    handleButton = (nome) => {
        alert(nome);
    };
    handleNama = (e) => {
        this.setState({
            nome: e.target.value,
        });
        console.log(this.state.nome);
    };
    handleCode = (e) => {
        this.setState({
            codingo: e.target.value,
        });
        console.log(this.state.codingo);
    };
    componentDidMount() {
        axios({
            method: "get",
            url: "https://newton.now.sh/api/v2/simplyfy/" + "",
            headers: {
                accept: "*/*",
            },
        })
            .then((data) => {
                console.log(data.data);
                this.setState({
                    modelos: data.data,
                });
            })
            .catch((error) => {
                console.log(error);
